text:
Über 100 Verbände und Unternehmen protestieren heute gegen die Wirtschaftspolitik von Rot und Grün. Wir brauchen eine Wirtschaftswende:
🟡 weniger bürokratische Vorgaben;
🟡 geringere Steuerbelastung;
🟡 Entlastung bei den Sozialabgaben;
🟡 niedrigere Energiekosten;
🟡 flexibleres Arbeitsrecht.

Auch zahlreiche saarländische Unternehmen machen beim bundesweiten Wirtschaftswarntag mit, u.A. <redacted_mention>, <redacted_mention>, <redacted_mention>, <redacted_mention>, der Verband der Metall- und Elektroindustrie des Saarlandes e.V., Rein Spedition GmbH, Herges Stahl- und Blechbau GmbH, und Saar Metallwerke GmbH. 

Wer einen Kurswechsel und mehr Wachstum will, muss am 23. Februar FDP wählen!

Die deutsche Migrationspolitik muss sich grundlegend ändern. Wir brauchen mehr Einwanderung in den Arbeitsmarkt statt in die Sozialsysteme. Gleichzeitig ist eine Verschärfung des Aufenthaltsrechts für Straftäter und Gefährder überfällig.

Es braucht ein politisches Signal aus der Mitte des Bundestages. Die Vorschläge der Union in ihrem Antrag halte ich im Kern für sinnvoll. Ergänzend dazu schlägt die FDP folgende Punkte vor:

🟡 “Abschiebehaft Plus” für eine schnellere Inhaftierung verurteilter Flüchtlinge;
🟡 Zentralisierung der Zuständigkeit für Abschiebungen beim Bund;
🟡 Ausreisezentren an den großen deutschen Flughäfen;
🟡 keine Entwicklungszusammenarbeit mit Ländern, die sich weigern, eigene Staatsbürger zurückzunehmen;
🟡 keine Sozialleistungen mehr für Ausreisepflichtige;
🟡 kein Familiennachzug von Migranten;
🟡 Drittstaatenverfahren;
🟡 Zurückweisung illegaler Grenzübertritte.

Auch im Saarland besteht dringender Handlungsbedarf: Es gibt nach wie vor keine Abschiebehaftplätze – das muss sich ändern. Was ist eure Meinung dazu?
